import React, { Component } from 'react';

//Ebrite token.. we should store this elsewhere
const token = "WKCHBZHI5XOXOL4XX7MR";

var eventArray = []
var query_1 = "https://app.ticketmaster.com/discovery/v2/events.json?classificationName=music&dmaId=343&apikey=W1pcXuKqQdPy3aAzokBdFdcfQYOtx8Zb";

var eventbrite_query_1 = `https://www.eventbriteapi.com/v3/events/search/?sort_by=date&location.latitude=36.162663&location.longitude=-86.781601&token=${token}&expand=venue`

export class EventbriteInfo extends Component {

    state = {
        eventList : []
    };


    getTicketmasterConcertInfo = () => {
        fetch(query_1)
            .then(results => results.json())
            .then(allConcerts => {
                allConcerts._embedded.events.forEach(concert => {
                    console.log(concert)


                    let INPUT_OBJ = {
                        type: "",
                        name: "",
                        location: "",
                        details: ""
                    }
                    INPUT_OBJ.type = "Concerts";
                    INPUT_OBJ.name = concert.name;
                    INPUT_OBJ.location = concert._embedded.venues[0].name;
                    INPUT_OBJ.details = concert.classifications[0].genre.name;

                    eventArray.push(INPUT_OBJ)
                })
                this.setState({ eventList : eventArray})
            })
        // console.log(INPUT_OBJ)
    }
    componentDidMount(){
        this.getTicketmasterConcertInfo();
    }

    render() {
        // console.log("Event List in State :", this.state.eventList)

        return (

            <>
                {this.state.eventList.map((event, i)=> {
                    return (
                        <ul key={i}>
                            <h4 key={event.name}>{event.name}</h4>
                            <p key={event.location}>{event.location}</p>
                            <p key={event.type}>{event.type}</p>
                            <p key={event.details}>{event.details}</p>
                        </ul>
                    )
                })}
            </>
        );
    }
}

export default EventbriteInfo;
